import React from "react";
import CatPerson from "./CatPerson";

const CatItems = ({ data, loading, isEmpty}) => {
  return (
    <div className="cat__items">
      {loading ? (
        <div className="lds-ellipsis spinner">
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      ) : Object.keys(data).length === 0 || isEmpty  ? (
        <h2 className="cat__no">Такой кэшбэк не найден</h2>
      ) : (
        Object.keys(data).map((person) => (
          <CatPerson key={person} person={person} data={data[person]} />
        ))
      )}
    </div>
  );
};

export default CatItems;
